const ezcastList=document.getElementById("ezcastList");const configList=document.getElementById("configList");getEZCasts();getSharedConfigs();function onEZCastsLoaded(b){for(var a=0;a<b.length;a++){ezcastList.innerHTML+='<a class="list-item" href="/pages/device.php?id='+b[a].id+'"><i class="device list-icon"></i>'+b[a].name+"</a>"}}function onSharedConfigsLoaded(b){for(var a=0;a<b.length;a++){configList.innerHTML+='<a class="list-item" href="/"><i class="config list-icon"></i>'+b[a].name+"</a>"}};